import React from 'react';
import '../../App.css';
import Footer from '../Footer';

export default function Team() {
    return (
        <>
            <div className="team-container">
                <img src="/images/meghan.png" alt="Meghan" className="team-member" />
                <img src="/images/nawal.png" alt="Nawal" className="team-member" />
                <img src="/images/lexi.png" alt="Lexi" className="team-member" />
                <img src="/images/aakash.png" alt="Aakash" className="team-member" />
            </div>
            <Footer />
        </>
    );
}
